import React from 'react';

const Family = () => {
  return (
    <section id="family">
      <h2>My Family</h2>
      <p>I belong to a lovely family of 4 members, including my parents, siblings, and myself. My family has always been a great support to me throughout my life.</p>
    </section>
  );
};

export default Family;
